Garibaldi began his career at Argentinos Juniors, making his senior debut in 1987. He went on to play for Barcelona, Roma, Milan, Inter Milan and Atlético Madrid, winning a La Liga championship with Atlético Madrid in 2003. He was part of the Argentine national team that won the Copa América in 1995 and the World Cup in 2002. He retired from playing in 2007. Garibaldo has been appointed coach of Independiente since December 2014.

